import { TopCatagories } from "../Components/TopCatagories/TopCatagories";
import { Tutor } from "../Components/Tutot/Tutor";


function Home() {
  return ( 
    <>
    <TopNav />
    <BottomNav />
    <Hero />
    <TopCatagories />
    <AboutMe />
    <Courses />
<Tutor />




    </>
   );
}

export default Home;
